import './App.css';
import React from 'react';
import Header from './components/header.js'
import Footer from './components/footer.js'


function App() {
    return (
        <>
            <Header />
            <h1>Welkom op de site van mandemt</h1>
            <a href="https://github.com/mandemt/tt-fa/wiki">Wiki</a>
            <p>Dit is de applicatie waarop je een bar chart van een .json dataset kunt renderen, en de meest gebruikte kleuren van verschillende schidlers kunt zien! Er zit veel werk achter, en als je wilt deelnemen kun je via deze repository het project clonen: </p>
            <Footer />
        </>
    )
}

export default App;
